import React from 'react'
import Footer from '../footer'
import Header from '../Header'

function Blogsingle() {
    use
    return (
        <div>
           <Header listing background="white" color="gray" border="1px solid lightgray" />
           
            <Footer/>
        </div>
    )
}

export default Blogsingle;
